import React from 'react';

function Grid({ robotPosition }) {
  const cellStyle = 'm-auto w-12 h-12 border border-gray-300';
  const robotStyle = 'bg-green-500 w-12 h-12 absolute';
  const endSquareStyle = 'bg-red-500 w-12 h-12 relative bottom-0 right-0';

  return (
    <div>
        <div>
            <div class="self-center ">
      <div class="text-3xl max-w-xs">
        <div class="flex -mb-2 gap-2">
          <div id="1" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="2" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="3" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
        </div>
        <div class="flex -mb-2 gap-2">
          <div id="4" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="5" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="6" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
        </div>
        <div class="flex -mb-2 gap-2">
          <div id="7" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="8" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
          <div id="9" class="flex items-center justify-center w-20 mb-4 h-20 bg-transparent border-white border-2 rounded-xl bg-white bg-opacity-0 hover:bg-opacity-25 duration-300"></div>
        </div>
      </div>

    </div>

            
        </div>
        <div className="grid grid-cols-5 gap-5">
        {Array.from({ length: 25 }, (_, index) => (
            <div key={index} className={cellStyle}></div>
        ))}
        <div
            className={`${robotStyle} top-${robotPosition.y * 12} left-${robotPosition.x * 12}`}
        ></div>
        <div className={endSquareStyle}></div>
        </div>
    </div>
    
  );
}

export default Grid;
